import React from "react";
import { NavLink } from "react-router-dom";

const Footer = () => {
  return (
    <div className="footer-container">
    <footer className="footer bg text-white py-1 fixed-bottom">
      <div className="container">
        <div className="row">
          <div className="col-md-3">
            <h4>FINE ART</h4>
          </div>
          <div className="col-md-3">
            <h5>Navigation</h5>
            <ul className="nav flex-column">
              <li className="nav-item mb-2">
                <NavLink to="/" className="nav-link p-0 text-white">
                  Home
                </NavLink>
              </li>
              <li className="nav-item mb-2">
                <NavLink to="/About" className="nav-link p-0 text-white">
                  About
                </NavLink>
              </li>
              <li className="nav-item mb-2">
                <NavLink
                  to="/Contact"
                  className="nav-link p-0 text-white"
                >
                  Contact Us
                </NavLink>
              </li>
            </ul>
          </div>
          <div className="col-md-6">
            <h5>Subscribe to our newsletter</h5>
            <p>Monthly digest of what's new and exciting from us.</p>
            <div className="input-group">
              <input
                type="text"
                className="form-control"
                placeholder="Email address"
              />
              <button className="btn btn-primary rounded-end" type="button">
                Subscribe
              </button>
            </div>
          </div>
        </div>
        <div className="row mt-4 border-top">
          <div className="col-md-6">
            <p>© 2024 Polytech Paris Saclay, Inc. All rights reserved.</p>
          </div>
          <div className="col-md-6 text-end">
            <ul className="list-inline">
              <li className="list-inline-item me-3">
                <NavLink className="link-light" to="#">
                  <i className="fa fa-facebook fa-lg"></i>
                </NavLink>
              </li>
              <li className="list-inline-item me-3">
                <NavLink className="link-light" to="#">
                  <i className="fa fa-instagram fa-lg"></i>
                </NavLink>
              </li>
              <li className="list-inline-item">
                <NavLink className="link-light" to="#">
                  <i className="fa fa-twitter fa-lg"></i>
                </NavLink>
              </li>
            </ul>
          </div>
        </div>
      </div>
    </footer>
    </div>
  );
};

export default Footer;





















